export const getCurrencies = async () => {
  try {
    const requestResponse = await fetch('https://economia.awesomeapi.com.br/json/all');
    const data = await requestResponse.json();
    const currencieArr = Object.keys(data);
    return currencieArr.filter((actualCurrencie) => actualCurrencie !== 'USDT');
  } catch (error) {
    throw new Error(error);
  }
};

export const getCurrencieValue = async () => {
  try {
    const requestResponse = await fetch('https://economia.awesomeapi.com.br/json/all');
    const data = await requestResponse.json();
    return data;
  } catch (error) {
    throw new Error(error);
  }
};
